Description
. 
Female
(WAM T145210). Carapace brownish-grey with yellowish-brown head region, a distinct dark median strip and yellow brown patches on carapace flanks (
Fig. 5A
). Eyes small and their rows slightly recurved, all of them on tubercles, lateral eyes very close and almost touching and apart from median eyes by its length (
Fig. 5A
). Chelicerae with pale yellow paturon and dark brown fangs (
Fig. 5B
). Legs segments varying shades of brown, patellae I conspicuously yellowish-brown and tibia IV almost entirely very dark brown to black (
Figs. 5A, B
). Labium and endites pale yellow, endites laterally brown (
Fig. 5B
). Sternum triangular, but indented at coxae, brown with distinct elongated yellowish-brown patch in anterior half and indistinct lighter patches at bases of coxae (
Fig. 5B
). Abdomen elongated, anteriorly with a deep central division forming two pointed shoulders above cardiac area (
Fig. 5A
); dorsum beige but darkening laterally and there with thin light lines, linear pattern also dorsally on abdominal tail (
Fig. 5A
). Tip of abdominal tail dark brown with five protuberances, the two ventral ones being very short, dorso-lateral ones long and dorso-median one very long (
Fig. 5C
). Venter brown, with few yellow-brown spots between genital area and spinnerets; two transverse pale yellow lines at the base of the tail (
Fig. 5B
). Spinnerets basally brown, apically light brown (
Fig. 4B
). Epigynum scape subquadrate, rebordered and with distinct antero-lateral arches (
Fig. 5D
). Spermathecae dark brown, very sclerotized, spherical and bearing two thick tubular copulatory ducts (
Fig. 5E
).

Male
(WAM 97/1976). Carapace pale orange-brown with broad dusky brown lateral bands and a thin brown median line from eyes to fovea (
Fig. 6A
). Eyes proportionally bigger than in females and their rows slightly re- curved, all four dyads on tubercles, with eyes relatively close to each other (
Fig. 6A
). Chelicerae with orange brown paturon and fangs. Legs yellowish-brown, femora somewhat darker (
Figs. 6A, B
). Labium and endites orange brown, labium anteriorly and endites medially lighter (
Fig. 6B
). Sternum shape as in female, orange brown with darker contours (
Fig. 6B
). Abdomen ovoid but tapering posteriorly, with lateral ridges and posterior rings (
Fig. 6A
), dorsum beige, with indistinct darker patches, laterally lighter (
Fig. 6A
). Venter beige, with a light brown hue between lungs and spinneret and scattered brown to black spots (
Fig. 6B
). Spinnerets orange-brown (
Fig. 6B
) Terminal apophysis of pedipalp ovoid, longer than wide (
Figs. 6C
; 
7
); embolus curved medially, but with straight tip (
Figs. 6C
; 
7
); conductor elongated and sclerotized, with a finger-like tip and ridged base; median apophysis crescent-shaped and with numerous teeth-like tubercles (
Figs. 6C, D
; 
7
); paramedian apophysis forms a ridge towards conductor (
Figs. 6C
; 
7
); paracymbium short and hook-like (
Fig. 6D
).

Males can vary in carapace and abdomen colour hue and pattern, which include shades from pale beige to orange and dark brown (
Figs. 8B, C
). The shape of the abdomen is variable with respect to the length of the abdominal tail (
Figs. 8B, C
), although short males predominate in collections.
